import fexportada from '../../store/prueba/reducer'
import { connect } from 'react-redux'

const prueba = ({interruptor}) =>{
    return interruptor
}
const mapStateToProps = (state)=>{
    return{
        interruptor: fexportada(state)
    }
}
export default connect(mapStateToProps)(prueba)
